import React from "react";
import styled from "styled-components";
import { GiHamburgerMenu } from "react-icons/gi";
import { AiOutlineSearch } from "react-icons/ai";
const SecondNavbar = () => {
  return (
    <Wrapper>
      <div className="containermain">
        <div className="category">
          <GiHamburgerMenu />
          Kateqoriyalari goster
        </div>

        <div className="search">
          <input type="text" placeholder="Mehsul axtar" className="secinput" />
          <AiOutlineSearch />
        </div>
      </div>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  width: 100%;
  background: var(--main-color);
  height: 10vh;
  display: flex;

  .containermain {
      background: red;
      width: 40%;
      height: 100%;
      margin-left: 11%;
      display: flex;
      align-items: center;
      justify-content: space-between;
  }
  .secinput {
    width: 100%;
    height: 30PX;
  }

    .category {
        width: 200px;
        background: green;
        
    }

`;
export default SecondNavbar;
